import React from 'react'

const Audio = () => {
    const baseUrl = 'http://127.0.0.1:5000/analyze-mosquitoes'
    const [audioNumber, setudioNumber] = React.useState(null)

    const imageList = [1, 2, 3, 4];

    return (
       <>
        <div className='flex gap-5'>
            {imageList?.map((item) => (
                <>
                <div className='p-10 background-red' key={item} 
                    onClick={() => setaudioNumber(item)}
                >{item}</div>
                </>
            ))}
        </div>
       <div className='flex justify-center items-center'>
       {audioNumber && <img src={`${baseUrl}/${audioNumber}`} width={500} height={300}/>}
       </div>
        </>
    )
}

export default Audio
